import React from "react";
import { Helmet } from "react-helmet";
import Celuk from "./slug/Celuk";
const Contact = () => (
  <div>
    <Helmet>
      <meta
        name="google-site-verification"
        content="ex4TnhMimzJT8jbjjo3HU_r-qfQczMhdYfALH1gyM2s"
      />
      <title>Hubungi kasir online apps</title>
      <meta
        name="description"
        content="Untuk kebutuhan informasi konsultasi dan curhat yuk hubungi team kami."
      />
      </Helmet>
    <Celuk />
  </div>
);

export default Contact;
